const MainHeader = () => {
    return (
        <header>
            <nav>
                <ul>
                    <li>
                        {/*Link 를 통한 새로고침 방지하기 , 리액트에 저장되어 있는 state 도 그대로 유지*/}
                        <Link to={'/welcome'}>Welcome</Link>
                    </li>
                    <li>
                        <Link to={'/products'}>Products</Link>
                    </li>
                </ul>
            </nav>
        </header>
    )
};

export default MainHeader;
